pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
contract parsp{

    // Kontrat deploy edildiinde deploy eden adresi alr ve onu admin rolne eitler.
    constructor() public {
        RolesMap[msg.sender] = "SUPERVISOR";
    }

    // Report adnda bir yap oluturduk yapnn sahip olduu zellikleri tanmladk.
    struct Report{
        uint256 reportID;
        string reportHash;
        string reportName;
        string reportType;
    }

    // kontrat tarafndan oluturulmu toplam rapor saysnn atanaca deiken.
    uint256 TotalReportsCount;


    Report[] ReportsList;
    Report[] ValidReportsList;

    mapping(address => string) RolesMap;

    // Reportnin iindeki reportID yi Report ile maplemak iin olutuduruumuz map ilemi. 
    mapping(uint256 => Report) ReportsMap;    

    mapping(uint256 => string) ReportsValidity;

    // buras rol kontrol eden bir yap bu yapy fonksiyonlarn ierisine ekleyerek sadece admin rolune sahip adreslerin o fonksiyonlar altrmas salanr.
    modifier checkRole(string memory _role) {
        require(
            keccak256(abi.encode(RolesMap[msg.sender])) ==
                keccak256(abi.encode(_role))
        );
        _;
    }

     // bunu sadece admin arabilir.(checkAuth yaps sayesinde). stediimiz rolleri adreslere atayabiliriz.
    function setUserRole(address _userAddress, string memory _role)
        public
        checkRole("SUPERVISOR")
    {
        RolesMap[_userAddress] = _role;
    }

     // adreslere atadmz rolleri buradan kontrol edebiliriz. bunu grntlemek iin de admin olmaa art checkAuth la salanmtr.
    function getUserRole(address _userAddress)
        public
        view
        returns (string memory)
    {
        return RolesMap[_userAddress];
    }

    //bu fonksiyon parametre olarak Report alarak ReportList'e kayt eklememizi salar. 
    function createReport(
        string memory _reportHash,
        string memory _reportName,
        string memory _reportType
        ) public checkRole("LABORANT") {                     //bu fonksyionu sadece CREATER rolne sahip adresler altrabilir.
            Report memory newReport = Report({     //parametre olarak aldmz deerlerin Reportnin hangi deelrerine eitlememiz gerektiini atadmz yer
                reportID: TotalReportsCount,
                reportHash: _reportHash,
                reportName: _reportName,                            
                reportType: _reportType
            });

        ReportsMap[TotalReportsCount] = newReport;  
        ReportsValidity[TotalReportsCount] = "INVALID";
        ReportsList.push(newReport);
        TotalReportsCount++;

    }



    /* // GET REPORT FUNCTIONS
    function getReport(uint256 reportID) public view returns(string memory reportHash, string memory reportName, string memory reportType){
        Report memory report = ReportsMap[reportID];
        return (report.reportHash, report.reportName, report.reportType); 
    }*/

    function getAllReports() public view returns (Report[] memory) {
        return ReportsList;
    }

    function getReportCount() public view returns(uint256){
        return TotalReportsCount;
    }
}
